import React from 'react'

export default function Sidenav(props) {
  return (
    <ul>
        <li onClick={()=>{props.change("INBOX")}}>Inbox</li>
        <li onClick={()=>{props.change()}}>Today</li>
        <li>Next 7 Days</li>
        
    </ul>
  )
}
